import React from 'react';

class ToolBar extends React.Component {
    render() {
        return (
            <ul className='format-buttons m-0 px-2 d-flex flex-column align-items-center justify-content-center'>
                <button>
                    <span class="bi bi-palette"></span>
                </button>
                <button>
                    <span class="bi bi-slash-lg"></span>
                </button>
                <button>
                    <span class="bi bi-square"></span>
                </button>
                <button>
                    <span class="bi bi-circle"></span>
                </button>
                <button>
                    <span class="bi bi-triangle"></span>
                </button>
                <button>
                    <span class="bi bi-pentagon"></span>
                </button>
            </ul>
        );
    }
}

export default ToolBar;
